const Results = ({ query }) => {

	if (query === '') {
		console.log(query)
		return (
			<div>
				This is the default
			</div>
		)
	} else {
		return (
			<div>
			<Card >
					<Card.Title>A search result</Card.Title>
					<Card.Subtitle className="mb-2 text-muted">Available</Card.Subtitle>
					<Card.Text>Response payload</Card.Text>
			</Card>
			</div>
		)
	}


}

export default Results
